import React from "react";
import styled from "styled-components";
import AppLayout from "../components/AppLayout";
import { Card, Avatar } from "antd";
import {
  EditOutlined,
  HeartOutlined,
  CommentOutlined,
} from "@ant-design/icons";

const FeedCard = styled(Card)`
  width: 350px;
`;

const Home = () => {
  return (
    <AppLayout>
      <FeedCard></FeedCard>
    </AppLayout>
  );
};

export default Home;
